import React,{useState} from 'react'


const Todo =()=>{

    const[ todos, setTodos] = useState[

        {id: 1, todo:'coder'},
        {id: 2, todo:'dormir'},
        {id: 3, todo:'manger'}

    ] 


    return (
        <div>
            <h1>{todos.length}To-do</h1>
        </div>
    )
}

export default Todo
